export class AppComponent {
  title = 'frontend';
}
<div id="menu">
  <ul>
    <li><a routerLink="">Lista de clientes</a></li>
    <li><a routerLink="/save-client">Guardar cliente</a></li>
  </ul>
</div>
<router-outlet></router-outlet>
